import React,{useContext} from 'react'
import { contextData } from './Context'
import { Link } from 'react-router-dom'
import './blogStyles.css'
import { Advertise } from './Advertise'

export const TopFeaterudArts = () => {
    const [data] = useContext(contextData) 
    // console.log(data[0].title,data[1].id);
    // const oneData =data.filter((x)=>x.id<4);
    const data1=[];
    const data2=[];
    data.forEach(k=> {
    switch (k.id) {
        case "1":
            data1.push(data[k.id-1]);
            console.log(data1);
            break;
        case "2":
            data2.push(data[k.id-1]);
            console.log(data2);
            break;
        case "3":
            data2.push(data[k.id-1]);
            console.log(data2);
            break;
        default:
            break;

    }  
    });


    return (
        <div className='parentTfa'>
            {
                data1.map((a)=>
                <Link to={`${a.category}/${a.id}`}>
                    <div className="Topfetrd">
                        <img src={a.image} />
                        <p><b>{a.title}</b><br/>
                        {a.category}/{a.date}</p>
                    </div>
                </Link>
                )
            }<div className='sidePnt'>
            {
                data2.map((a)=>
                    <div className='sideBox'>
                        <img src={a.image}/>
                        <p><b>{a.title}</b><br/>
                        {a.category}/{a.date}</p>
                    </div>
                )
            }</div>
        </div>
    )
}
